import React from 'react'

export default function ProjectDisplay(props) {
    var projects = props.projects;

    return (
        <div className="cell small-10 medium-8 large-8">
           {projects.map(project => {
               return(
                <div className="cell small-10 medium-8 large-8 project">
                    <div className="small-12 medium-10 large-10" key={project.key}><span style={{marginTop: "100px"}}>{project.name}</span><br/>
                        <img src={project.image} style={{width: "550px", height: "auto", borderRadius: "10px"}}/>
                    </div>
                </div>    
               );
           })} 
        </div>
    )
}
